import React from 'react';


function Bohemian() {
    return (
        <div>
            <h1>Your style type is Bohemian. </h1>
            <img alt="" src="https://www.proprofs.com/api/ckeditor_images/New%20Project%20(14)(50).jpg" />
            <h3 className='resultDescr'>When it comes to fashion, anything goes for you, especially if it's whimsical and fun. You draw your style influences from all over, and you are a pro at mixing and matching.</h3>
        </div>
    );
};



export default Bohemian;
